	textSplit: function(props, blocks, font) {
		var h, w, tw, div_temp, block, text = {},
			post, f, width, val, lines, line, textTemp, lineBlock, lineBlocks = [],
			name = font.orientation;
		h = w = /horizontal/.test(name) ? props.h : props.w;
		for(var k = 0; k < blocks.length; k++) {
			block = blocks[k], f = $.extend(block.font, $.extend({}, font));
			post = block.position;
			if(/horizontal/.test(name)) {
				tw = eval(post.h)
			} else {
				tw = eval(post.w)
			}
			h = props.h, w = props.w, f = $.extend(f, block.fontStyle);
			div_temp = document.getElementById("area_div_temp");
			if(!div_temp) {
				div_temp = document.createElement("div");
				div_temp.setAttribute("id", "area_div_temp");
				document.body.appendChild(div_temp)
			}
			div_temp.style.opacity = 0;
			div_temp.style.visibility = "hidden";
			div_temp.style.display = "inline-block";
			div_temp.style.fontSize = f.size + "px";
			if(!block.text) {
				continue
			}
			val = block.text.replace(/\u00A0|\u0000/g, " ");
			lines = val.split(/\n/g);
			if(/horizontal/.test(name)) {
				lineBlock = {
					x: eval(post.x),
					y: eval(post.y) + tw,
					w: tw,
					h: eval(post.w),
					txt: [],
					rotate: true
				}
			} else {
				lineBlock = {
					x: eval(post.x),
					y: eval(post.y),
					w: tw,
					h: eval(post.h),
					txt: [],
					rotate: false
				}
			}
			for(var i = 0; i < lines.length; i++) {
				line = lines[i];
				div_temp.innerHTML = "";
				div_temp.innerHTML = line;
				if(div_temp.offsetWidth + 10 > tw) {
					div_temp.innerHTML = "";
					textTemp = "";
					for(var j = 0; j < line.length; j++) {
						div_temp.innerHTML += line[j];
						if(div_temp.offsetWidth + 10 <= tw) {
							textTemp += line[j];
							if(j == line.length - 1) {
								lineBlock.txt.push(textTemp);
								textTemp = "";
								div_temp.innerHTML = ""
							}
						} else {
							lineBlock.txt.push(textTemp + line[j]);
							textTemp = "";
							div_temp.innerHTML = ""
						}
					}
				} else {
					lineBlock.txt.push(line);
					textTemp = "";
					div_temp.innerHTML = ""
				}
			}
			div_temp.parentNode.removeChild(div_temp);
			lineBlocks.push({
				block: lineBlock,
				font: f
			})
		}
		return lineBlocks
	},
	getPostOnLine: {
		curve: function(h, c, g, b) {
			var a, f, e = c[0],
				d = c[1];
			a = h.x * Math.pow((1 - b), 3) + 3 * e.x * b * (1 - b) * (1 - b) + 3 * d.x * b * b * (1 - b) + g.x * b * b * b, f = h.y * Math.pow((1 - b), 3) + 3 * e.y * b * (1 - b) * (1 - b) + 3 * d.y * b * b * (1 - b) + g.y * b * b * b;
			return {
				x: a,
				y: f
			}
		},
		broken: function(h, m, j, n) {
			var o = [],
				a, c = 0,
				e, d;

			function k(l, i) {
				if(l.x == i.x) {
					return {
						len: Math.abs(i.y - l.y),
						hor: false,
						right: i.y > l.y ? true : false
					}
				}
				return {
					len: Math.abs(i.x - l.x),
					hor: true,
					right: i.x > l.x ? true : false
				}
			}
			a = k(h, m[0]), c += a.len, o[0] = a;
			for(var b = 0; b < m.length; b++) {
				if(b == m.length - 1) {
					a = k(m[b], j), c += a.len, o.push(a)
				} else {
					a = k(m[b], m[b + 1]), c += a.len, o.push(a)
				}
			}
			a = 0;
			for(var b = 0; b < o.length; b++) {
				a += o[b].len;
				if(a >= c / 2) {
					var g = o[b].right ? -a + c / 2 : a - c / 2,
						f = m[b] ? m[b] : j;
					if(o[b].hor) {
						e = f.x + g, d = f.y
					} else {
						e = f.x, d = f.y + g
					}
					break
				}
			}
			return {
				x: e,
				y: d
			}
		},
		normal: function(f, c, e, b) {
			var a, d;
			a = f.x + Math.abs((f.x - e.x) * b), d = f.y + Math.abs((f.y - e.y) * b);
			return {
				x: a,
				y: d
			}
		}
	},
